window.bookSummaryJSON = "<p>Country music star Boone Thrasher has never walked away from a fight, and he's willing to put everything on the line to win the woman he can't live without in the conclusion to the Real Dirty Duet by <i>USA Today</i> best-selling author Meghan March. </p> <p>In Nashville, country stars are a dime a dozen. </p> <p>I swore I'd never get caught up with one, but Boone Thrasher made a liar out of me. </p> <p>I said I'd never put my heart on the line, but he didn't ask before he stole it. </p> <p>Now we're facing my worst fears, and we'll see if this country boy is tough enough to see it through. </p> <p>Girls like me don't get happily ever afters...but maybe he'll prove that wrong, too. </p>"; 
